import ExpenseItem from "./components/ExpenseItem";

function App() {
  const ExpItems = [
    {
      name: "Food",
      cost: 2000,
      location: "Personal",
      date: new Date(20, 4, 23),
    },
    {
      name: "Bills",
      cost: 12000,
      location: "Business",
      date: new Date(10, 5, 23),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      {ExpItems.map((items, index) => {
        console.log(items, index);
        <ExpenseItem
          name={items[index].name}
          amount={items[index].cost}
          location={items[index].location}
          date={items[index].date}
        />;
      })}
    </div>
  );
}

export default App;
